    // Ensure that the pet ID is valid
    if (petId === null || petId === undefined) {
        throw new Error("Pet ID is invalid");
    }

    // Calculate the name of the pet from the pet ID
        function generateRandomIndex(userIdString) {
        let sum = 0;
        for (let char of userIdString) {
            sum += char.charCodeAt(0);
        }
        const index = sum % userId.length;

        return index;
    }
    
    // Return the name of the pet
    return fakeUsers[generateRandomIndex(userId)];
